CREATE TABLE GooglePlay(
   App            VARCHAR(194) NOT NULL PRIMARY KEY
  ,Category       VARCHAR(19) NOT NULL
  ,Rating         VARCHAR(3) NOT NULL
  ,Reviews        VARCHAR(8) NOT NULL
  ,Size           VARCHAR(18) NOT NULL
  ,Installs       VARCHAR(14) NOT NULL
  ,Type           VARCHAR(4) NOT NULL
  ,Price          VARCHAR(8) NOT NULL
  ,Content_Rating VARCHAR(15)
  ,Genres         VARCHAR(37) NOT NULL
  ,Last_Updated   VARCHAR(18) NOT NULL
  ,Current_Ver    VARCHAR(50)
  ,Android_Ver    VARCHAR(18)
);
